import './home.css';
import ReviewMiniature from '../components/ReviewMiniature'
const review1 = {
    "Title": "This is the title",
    "Date": "29-09-2022",
    "Comments": 5,
    "Rating": 8,
}

export default function Home(){
    return(
        <div className='home'>

{console.log(review1?.length)}

            {
                review1?.length > 0 
                ? (
                    <div className="container">
                        <ReviewMiniature review1={review1}/>
                    </div>
                ):(
                    <div className='empty'>
                        <h2>
                            No reviews found
                        </h2>
                    </div>
                )
            }
        </div>

    )
}
